import React, { useState, useEffect } from 'react';
import { Bell, User, Star, Calendar, BookOpen } from 'lucide-react';
import logo from '../logo/nujoom-logo.png';

const Header = ({ navigateToPage, currentPage }) => {
  const [scrolled, setScrolled] = useState(false);
  const [isMainPage, setIsMainPage] = useState(false);

  useEffect(() => {
    setIsMainPage(currentPage === 'mainPage' || currentPage === 'dashboard');

    const handleScroll = () => {
      if (window.scrollY > 10) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);

    // Clean up
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, [currentPage]);

  console.log("Current page:", currentPage); // Debug current page

  return (
    <div className={`fixed top-0 left-0 right-0 w-full z-50 transition-all duration-300 ${
      scrolled ? 'bg-white shadow-md' : 'bg-transparent'
    }`}>
      <div className="container mx-auto px-4 py-2">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            <div 
              className={`cursor-pointer flex items-center ml-4 font-bold text-xl transition-all duration-300 transform hover:scale-105 active:scale-95 ${
                isMainPage && !scrolled
                  ? 'text-white' 
                  : 'text-[#032425]'
              }`}
              onClick={() => navigateToPage('mainPage')}
            >
              <img src={logo} alt="Nujoom" className="h-10 w-auto transform origin-left transition-transform duration-300" />
            </div>

            <nav className="flex flex-wrap">
              <div 
                className={`cursor-pointer ml-4 transition-all duration-300 hover:opacity-80 ${
                  currentPage === 'playersPage' 
                  ? (isMainPage && !scrolled ? 'text-white font-bold text-base' : 'text-[#032425] font-bold text-base')
                  : (isMainPage && !scrolled ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-[#032425]')
                }`}
                onClick={() => navigateToPage('playersPage')}
              >
                المواهب
              </div>
              <div 
                className={`cursor-pointer ml-4 transition-all duration-300 hover:opacity-80 ${
                  currentPage === 'comparisons' 
                  ? (isMainPage && !scrolled ? 'text-white font-bold text-base' : 'text-[#032425] font-bold text-base')
                  : (isMainPage && !scrolled ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-[#032425]')
                }`}
                onClick={() => navigateToPage('comparisons')}
              >
                المقارنات
              </div>
              <div 
                className={`cursor-pointer ml-4 transition-all duration-300 hover:opacity-80 ${
                  currentPage === 'calendar' 
                    ? (isMainPage && !scrolled ? 'text-white font-bold text-base' : 'text-[#032425] font-bold text-base')
                    : (isMainPage && !scrolled ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-[#032425]')
                }`}
                onClick={() => navigateToPage('calendar')}
              >
                جدول المباريات
              </div>
              <div 
                className={`cursor-pointer ml-4 transition-all duration-300 hover:opacity-80 ${
                  currentPage === 'shortlistedPlayers' 
                    ? (isMainPage && !scrolled ? 'text-white font-bold text-base' : 'text-[#032425] font-bold text-base')
                    : (isMainPage && !scrolled ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-[#032425]')
                }`}
                onClick={() => navigateToPage('shortlistedPlayers')}
              >
                اللاعبين المفضلين
              </div>
              <div 
                className={`cursor-pointer ml-4 transition-all duration-300 hover:opacity-80 ${
                  currentPage === 'notes' 
                    ? (isMainPage && !scrolled ? 'text-white font-bold text-base' : 'text-[#032425] font-bold text-base')
                    : (isMainPage && !scrolled ? 'text-gray-300 hover:text-white' : 'text-gray-600 hover:text-[#032425]')
                }`}
                onClick={() => navigateToPage('notes')}
              >
                ملاحظاتي
              </div>
            </nav>
          </div>

          <div className="flex items-center">
            <button 
              className={`p-1.5 mr-1 ${
                currentPage === 'shortlistedPlayers' 
                  ? (isMainPage && !scrolled ? 'text-white' : 'text-[#032425]')
                  : (isMainPage && !scrolled ? 'text-gray-300' : 'text-gray-600')
              }`}
              onClick={() => navigateToPage('shortlistedPlayers')}
              title="اللاعبين المفضلين"
            >
              <Star size={18} />
            </button>
            <button 
              className={`p-1.5 mr-1 ${
                currentPage === 'calendar' 
                  ? (isMainPage && !scrolled ? 'text-white' : 'text-[#032425]')
                  : (isMainPage && !scrolled ? 'text-gray-300' : 'text-gray-600')
              }`}
              onClick={() => navigateToPage('calendar')}
              title="جدول المباريات"
            >
              <Calendar size={18} />
            </button>
            <button 
              className={`p-1.5 mr-1 ${
                currentPage === 'notes' 
                  ? (isMainPage && !scrolled ? 'text-white' : 'text-[#032425]')
                  : (isMainPage && !scrolled ? 'text-gray-300' : 'text-gray-600')
              }`}
              onClick={() => navigateToPage('notes')}
              title="ملاحظاتي"
            >
              <BookOpen size={18} />
            </button>
            <button className={`p-1.5 mr-1 ${isMainPage && !scrolled ? 'text-gray-300' : 'text-gray-600'}`}>
              <Bell size={18} />
            </button>
            <button className={`p-1.5 ${isMainPage && !scrolled ? 'text-gray-300' : 'text-gray-600'}`}>
              <User size={18} />
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
